description:
A discussion by friends with long-winded histories and a love of drinking results in four of them running off to house-sit for a long weekend while playing Killer, a schoolyard game where each player has to &quot;take out&quot; targets over a period of time using everything from water pistols to bits of cardboard with &quot;sword&quot; written on them.

As the game progresses and frustrations rise, sexual tensions surface and it's obvious that with the possibility of only one winner, some people will do anything for victory.

Who'll be the Dead Man Drinking?



written &amp; directed by Rohan Harris

starring Jen Greiss, Peter Love, Hannah Moltoni and Kurtis Wakefield

